// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

interface IDocumentStore {
    function getDocumentOwner(string memory documentCid) external view returns (address);
    function getDocumentReceiver(string memory documentCid) external view returns (address);
}

interface IPublicKeyStorage {
    function getRole(address walletAddress) external view returns (string memory);
}


contract AccessManager {

    IDocumentStore public documentStore;
    IPublicKeyStorage public publicKeyStorage;

    // Mapping from CID to receiver address to encrypted key
    mapping(string => mapping(address => string)) private encryptedContentKeys;
    mapping(string => mapping(address => string)) private contentIvs;
    mapping(string => mapping(address => bool)) private accessContentRequests;

    mapping(string => mapping(address => string)) private encryptedTenderKeys;
    mapping(string => mapping(address => string)) private tenderIvs;
    mapping(string => mapping(address => bool)) private accessTenderRequests;


    event EmitContentKey(
        address receiver,
        address sender,
        string encryptedKey,
        string iv,
        string cid
    );
    
    event EmitTenderKey(
        address receiver,
        address sender,
        string encryptedKey,
        string iv,
        string tenderId
    );

    event RequestAccessContent(
        address requester,
        address receiver,
        string cid,
        string documentName,
        string documentFormat,
        string tenderId
    );

    event RequestAccessTender(
        address requester,
        address receiver,
        string tenderId
    );

    struct EmitKeyInput {
        address receiver;
        string encryptedKey;
        string iv;
        string cid;
        string tenderId;
        string documentName;
    }

    struct EmitTenderKeyInput {
        address receiver;
        string encryptedKey;
        string iv;
        string tenderId;
    }

    struct RequestAccessInput {
        address receiver;
        string tenderId;
        string cid;
        string documentName;
        string documentFormat;
    }

    struct EmitCombinedKeyInput {
        EmitKeyInput contentKey;
        EmitTenderKeyInput tenderKey;
    }

    constructor(address documentStoreAddress, address publicKeyStorageAddress) {
        documentStore = IDocumentStore(documentStoreAddress);
        publicKeyStorage = IPublicKeyStorage(publicKeyStorageAddress);
    }

    function emitContentKey(
        EmitKeyInput memory input
    ) external {
        bool isDocumentOwner = documentStore.getDocumentOwner(input.cid) == msg.sender;
        bool isDocumentReceiver = documentStore.getDocumentReceiver(input.cid) == msg.sender;
        
        if (!isDocumentOwner && !isDocumentReceiver) {
            revert(string(abi.encodePacked("Sender is not authorized to emit content key")));
        }

        encryptedContentKeys[input.cid][input.receiver] = input.encryptedKey;
        contentIvs[input.cid][input.receiver] = input.iv;
        
        emit EmitContentKey(input.receiver, msg.sender, input.encryptedKey, input.iv, input.cid);
    }

    function requestAccessContent(RequestAccessInput memory input) external {
        if (keccak256(abi.encodePacked(publicKeyStorage.getRole(msg.sender))) != keccak256(abi.encodePacked("third_party"))) {
            revert(string(abi.encodePacked("Sender is not a third_party")));
        }

        require(accessContentRequests[input.cid][msg.sender] == false, "Access already requested");

        accessContentRequests[input.cid][msg.sender] = true;

        emit RequestAccessContent(msg.sender, input.receiver, input.cid, input.documentName, input.documentFormat, input.tenderId);
    }

     function emitTenderKey(
        EmitTenderKeyInput memory input
    ) external {
        bool isDocumentOwner = documentStore.getDocumentOwner(input.tenderId) == msg.sender;
        bool isDocumentReceiver = documentStore.getDocumentReceiver(input.tenderId) == msg.sender;
        
        if (!isDocumentOwner && !isDocumentReceiver) {
            revert(string(abi.encodePacked("Sender is not authorized to emit tender key")));
        }
        
        encryptedTenderKeys[input.tenderId][input.receiver] = input.encryptedKey;
        tenderIvs[input.tenderId][input.receiver] = input.iv;
        
        emit EmitTenderKey(input.receiver, msg.sender, input.encryptedKey, input.iv, input.tenderId);
    }

    function emitCombinedKeys(
        EmitCombinedKeyInput memory input
    ) external {
        bool isDocumentOwner = documentStore.getDocumentOwner(input.contentKey.cid) == msg.sender;
        bool isDocumentReceiver = documentStore.getDocumentReceiver(input.contentKey.cid) == msg.sender;
        
        if (!isDocumentOwner && !isDocumentReceiver) {
            revert(string(abi.encodePacked("Sender is not authorized to emit keys")));
        }

        // Emit content key
        encryptedContentKeys[input.contentKey.cid][input.contentKey.receiver] = input.contentKey.encryptedKey;
        contentIvs[input.contentKey.cid][input.contentKey.receiver] = input.contentKey.iv;
        emit EmitContentKey(input.contentKey.receiver, msg.sender, input.contentKey.encryptedKey, input.contentKey.iv, input.contentKey.cid);

        // Emit tender key
        encryptedTenderKeys[input.tenderKey.tenderId][input.tenderKey.receiver] = input.tenderKey.encryptedKey;
        tenderIvs[input.tenderKey.tenderId][input.tenderKey.receiver] = input.tenderKey.iv;
        emit EmitTenderKey(input.tenderKey.receiver, msg.sender, input.tenderKey.encryptedKey, input.tenderKey.iv, input.tenderKey.tenderId);
    }

    function requestAccessTender(string memory tenderId, address receiver) external {
        if (keccak256(abi.encodePacked(publicKeyStorage.getRole(msg.sender))) != keccak256(abi.encodePacked("third_party"))) {
            revert(string(abi.encodePacked("Sender is not a third_party")));
        }

        require(accessTenderRequests[tenderId][msg.sender] == false, "Access already requested");

        accessTenderRequests[tenderId][msg.sender] = true;

        emit RequestAccessTender(msg.sender, receiver, tenderId);
    }

    function getEncryptedContentKey(string memory cid, address receiver) external view returns (string memory, string memory) {
        return (encryptedContentKeys[cid][receiver], contentIvs[cid][receiver]);
    }

    function getEncryptedTenderKey(string memory tenderId, address receiver) external view returns (string memory, string memory) {
        return (encryptedTenderKeys[tenderId][receiver], tenderIvs[tenderId][receiver]);
    }

}

contracts/DocumentStore.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

interface ITenderManager {
    function getOwner(string memory tenderId) external view returns (address);
    function addParticipant(string memory tenderId, string memory name, string memory email, address participant) external;
} 

contract DocumentStore {
    struct InfoDocument {
        string tenderId;
        string documentCid;
        string documentName;
        string documentFormat;
    }

     struct Document {
        address documentOwner;
        string documentCid;
        string documentName;
        string documentFormat;
        uint256 submissionDate;
        string tenderId;
        address receiver;
    }

    mapping(string => Document[]) private tenderDocuments;
    mapping(string => InfoDocument[]) private tenderInfoDocuments;

    mapping(string => address) public documentOwner;
    mapping(string => address) public documentReceiver;
    ITenderManager public tenderManager;

    event DocumentUploaded(string indexed tenderId, address indexed contestant, string documentCid, string documentName, string documentFormat, address receiver, uint256 submissionDate);

    constructor(address tenderManagerAddress) {
        tenderManager = ITenderManager(tenderManagerAddress);
    }

    function uploadInfoDocument(InfoDocument memory input) public {
        require(
            tenderManager.getOwner(input.tenderId) == msg.sender,
            "Only tender owner can upload tender info documents"
        );

        InfoDocument memory newDocument = InfoDocument({
            tenderId: input.tenderId,
            documentCid: input.documentCid,
            documentName: input.documentName,
            documentFormat: input.documentFormat
        });

        tenderInfoDocuments[input.tenderId].push(newDocument);
    }

    function uploadDocument(Document memory input) public {
        documentOwner[input.documentCid] = msg.sender;
        documentReceiver[input.documentCid] = input.receiver;

        emit DocumentUploaded(input.tenderId, msg.sender, input.documentCid, input.documentName, input.documentFormat,  input.receiver, block.timestamp);
    }

    function getTenderInfoDocuments(string memory tenderId) public view returns (InfoDocument[] memory) {
        return tenderInfoDocuments[tenderId];
    }

    function getDocumentOwner(string memory documentCid) public view returns (address) {
        return documentOwner[documentCid];
    }   

    function getDocumentReceiver(string memory documentCid) public view returns (address) {
        return documentReceiver[documentCid];
    }

}

